    pub fn reset(&mut self) {
        self.board = BitBoard::new();
    }

    fn read_vec(f: &mut BufReader<File>) -> Vec<f32> {
        let mut num_line = String::new();
        f.read_line(&mut num_line).expect("help");
        let n: usize = num_line.trim().parse().unwrap();
    
        let mut line = String::new();
        f.read_line(&mut line);
        line = line.trim().to_string();
        let mut result = Vec::with_capacity(n);
        for n in line.split(char::is_whitespace) {
            result.push(n.parse().unwrap());
        }
        return result;
    }

    pub fn from_file(_exploration: f64, filename: String) -> ZeroAI {
        let mut f = BufReader::new(File::open(filename).expect("hello"));

        let dense_bias: Vec<f32> = ZeroAI::read_vec(&mut f);
        let dense_kernel: Vec<f32> = ZeroAI::read_vec(&mut f);
        let dense_1_bias: Vec<f32> = ZeroAI::read_vec(&mut f);
        let dense_1_kernel: Vec<f32> = ZeroAI::read_vec(&mut f);
        let dense_2_bias: Vec<f32> = ZeroAI::read_vec(&mut f);
        let dense_2_kernel: Vec<f32> = ZeroAI::read_vec(&mut f);

        let layer0 = Layer::new(57, 81, dense_kernel, dense_bias);
        let layer1 = Layer::new(57, 57, dense_1_kernel, dense_1_bias);
        let layer2 = Layer::new(82, 57, dense_2_kernel, dense_2_bias);
        let layer_vec = vec![layer0, layer1, layer2];
        let nn = NeuralNet::new(layer_vec);

        ZeroAI {
            //exploration: ((1.0 - epsilon) * (std::u16::MAX as f64)) as u16,
            exploration: _exploration,
            board: BitBoard::new(),
            me: 1,
            rand: SmallRng::from_entropy(),
            net: nn,
        }

    }

